export default class LoginField extends React.Component {
    render() {
        return (
            <div className="div">
                <div className="card-header bg-primary text-white">
                    <Header />
                </div>
                <div className="card-body">
                    <Username />
                </div>
                <div className="card-body">
                    <Password />
                </div>
                <div className="card-footer">
                    <LoginButton />

                </div>
            </div>
        );
 }
}
